function run(listaDeProjetos) {
    const dados = typeof listaDeProjetos === 'string' ? JSON.parse(listaDeProjetos) : listaDeProjetos;

    const retorno = {};
    const nomes = ["nome1", "nome2", "nome3", "nome4", "nome5"];
    const descricoes = ["descricao1", "descricao2", "descricao3", "descricao4", "descricao5"];

    for (let i = 0; i < dados.data.length && i < nomes.length; i++) {
        const projeto = dados.data[i];
        retorno[nomes[i]] = projeto.name;
        retorno[descricoes[i]] = projeto.description;
    }

    return retorno;
}
